import React , { useState } from 'react';
import data from './data';


const List = () => {
  const numberOfBirthdays = data.length;
  return (
    <>
      <main className='container'>
        <section className='section'>
        <h3>{numberOfBirthdays} birthdays today</h3>
        </section>

      </main>

    </>
  );
};

export default List;
